svg.script:
let minFontSize = 13;
let maxFontSize = 18;
let maxTextLength = 76;
let correctionLength = 6
const getFontSize = (textLength) => {
if(textLength > maxTextLength) {
return `${minFontSize}px`
}  if(textLength < (maxTextLength - correctionLength)) {
return `${maxFontSize}px`
}
}
const boxes = document.querySelectorAll('.svgResizableText')
boxes.forEach(box => {
const textLength = box.textContent.length
box.setAttribute('font-size', getFontSize(textLength));
if(box.textContent.length > (maxTextLength - correctionLength)) {
box.textContent = box.textContent.substring(0, maxTextLength) + '...'
}
})
